INSERT INTO `comments` (`id`, `user_id`, `project_id`, `comment`, `created_at`, `updated_at`) VALUES
(1, 3, 6, 'We need to keep aside some food for the hungry and poor people. There are many people who do not get proper food to eat.', '2019-10-21 17:24:04', '2019-10-21 17:24:04'),
(2, 4, 6, 'We should not waste food instead, we should donate it to the hungry and needy people, this will provide them happiness and satisfaction.', '2019-10-21 17:25:25', '2019-10-21 17:25:25'),
(3, 5, 6, 'We should do this often, there are NGOs who help these kind of people and work for the non profit organizations for the welfare of the poor and needy people.', '2019-10-21 17:26:01', '2019-10-21 17:26:01'),
(4, 6, 6, 'Doing this task is considered as a blessing to humanity, it is an act of kindness and compassion that we show to the needy people', '2019-10-21 17:26:45', '2019-10-21 17:26:45'),
(5, 7, 6, 'There are many people who do not get proper food to eat, This campaign will help them go to sleep with their stomach’s full.', '2019-10-21 17:33:15', '2019-10-21 17:33:15'),
(6, 8, 1, 'I used to have a cow in my village. I fed her grass and leaves from plants. I also used to pet her and play with her.', '2019-10-21 17:45:08', '2019-10-21 17:45:08'),
(7, 9, 1, 'You can get some good karma when you feed animals like these. These animals needs our love and support. We can stand for her. She give us so many useful things', '2019-10-21 17:45:43', '2019-10-21 17:45:43'),
(8, 10, 1, 'Feeding cows can bring you good luck. This will help you to bag some good karma. There are many benefits of keeping a cow.', '2019-10-21 17:46:31', '2019-10-21 17:46:31'),
(9, 11, 1, 'I get an awesome feeling whenever I feed cows. These animals need our love and support. If we care for them, they will care for us!', '2019-10-21 17:47:27', '2019-10-21 17:47:27'),
(10, 12, 1, 'It’s time we did something for the innocent animals! They need to be supported, loved, respected as well as cared for.', '2019-10-21 17:48:15', '2019-10-21 17:48:15'),
(11, 12, 1, 'It’s time we did something for the innocent animals! They need to be supported, loved, respected as well as cared for.', '2019-10-21 17:48:21', '2019-10-21 17:48:21'),
(12, 13, 5, 'An awesome initiative taken by 1INR founders. We should take up such causes more often and help nature.', '2019-10-21 17:54:40', '2019-10-21 17:54:40'),
(13, 13, 5, 'An awesome initiative taken by 1INR founders. We should take up such causes more often and help nature.', '2019-10-21 17:55:46', '2019-10-21 17:55:46'),
(14, 14, 5, 'Feeding the birds grains and seeds is a noble cause. I used to put grains for the birds to eat on my terrace.', '2019-10-21 18:04:11', '2019-10-21 18:04:11'),
(15, 15, 5, 'We strongly believe that feeding birds has an effect on one’s karma. You can easily bag some good karma and be one step closer to nature.', '2019-10-21 18:05:07', '2019-10-21 18:05:07'),
(16, 16, 5, 'Keep it up guys, you are doing a wonderful thing. Keep up the good work and always help others animals and humans.', '2019-10-21 18:05:53', '2019-10-21 18:05:53'),
(17, 17, 5, 'We all should devote time towards feeding birds. It is a wonderful cause taken up by the NGO. We should all support and cheer for such causes', '2019-10-21 18:06:30', '2019-10-21 18:06:30'),
(18, 18, 2, 'Sponsoring a child’s education is a noble deed! This is the need of the hour that we need to help young children. They depend on us for support.', '2019-10-21 18:23:20', '2019-10-21 18:23:20'),
(19, 18, 2, 'Everyone should do this at least once! Supporting child education is a noble and humble deed. This will surely benefit us.', '2019-10-21 18:37:45', '2019-10-21 18:37:45'),
(20, 19, 2, 'I have paid the fees for a class 2 girl, the feeling is great! Doing this provides immense peace, happiness and satisfaction to us.', '2019-10-21 18:38:30', '2019-10-21 18:38:30'),
(21, 20, 2, 'This is a very humble deed! We need to support the poor and needy children by helping them learn and grow through the right education.', '2019-10-21 18:39:07', '2019-10-21 18:39:07'),
(22, 21, 2, 'A great initiative by OneINR! This will help us shape the future of our country and our children depend on us', '2019-10-21 18:39:55', '2019-10-21 18:39:55'),
(23, 1, 1, 'hfgdfr', '2019-10-22 15:21:14', '2019-10-22 15:21:14');
