white-space: pre-wrap;\\\">There are many people who do not have money to buy food. They go to sleep with their hungry stomachs. It is a pity to see people who have money and who splurge lavishly but fail to give the needy some food. 1INR has collaborated with NGOs and created the Roti Daan Campaign for the needy and poor people. In this campaign we make sure to donate the target amount of Rotis or Chapatis to poor and hungry people so that they can have a full meal and can go to bed with their stomach filled in and not sleep hungry.<\\/span><\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.2; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\\">This initiative was possible only through 1INR team, who care about people and the problems that they go through. It is an act of kindness that we want to show as a part of the good gesture towards society.<\\/span><\\/p>\\\";s:10:\\\"video_link\\\";N;s:4:\\\"goal\\\";i:500;s:10:\\\"commission\\\";i:10;s:6:\\\"target\\\";i:570;s:14:\\\"recurring_days\\\";i:7;s:6:\\\"status\\\";i:1;s:22:\\\"display_on_home_status\\\";i:1;s:8:\\\"encodeId\\\";s:18:\\\"pehli-roti-daan-ki\\\";s:9:\\\"days_left\\\";i:1;s:7:\\\"project\\\";O:8:\\\"stdClass\\\":20:{s:2:\\\"id\\\";i:3;s:7:\\\"user_id\\\";i:2;s:5:\\\"title\\\";s:18:\\\"Pehli Roti Daan Ki\\\";s:4:\\\"slug\\\";s:18:\\\"pehli-roti-daan-ki\\\";s:11:\\\"description\\\";s:96:\\\"1INR has collaborated with NGOs and created the Roti Daan Campaign for the needy and poor people\\\";s:16:\\\"long_description\\\";s:2058:\\\"<p dir=\\\"ltr\\\" style=\\\"line-height: 1.2; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\\">Do not waste food, DONATE it! Food is the primary source that drives ones forward. It takes a farmer 100 Days to produce food, and it takes just a minute to eat it or consume it. In our country where there is a shortage of food for the poor people, we as humans should make it a goal to deliver food to the needy.<\\/span><\\/p>\\r\\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.2; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\\">There are many people who do not have money to buy food. They go to sleep with their hungry stomachs. It is a pity to see people who have money and who splurge lavishly but fail to give the needy some food. 1INR has collaborated with NGOs and created the Roti Daan Campaign for the needy and poor people. In this campaign we make sure to donate the target amount of Rotis or Chapatis to poor and hungry people so that they can have a full meal and can go to bed with their stomach filled in and not sleep hungry.<\\/span><\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p dir=\\\"ltr\\\" style=\\\"line-height: 1.2; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\\\"><span style=\\\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\\\">This initiative was possible only through 1INR team, who care about people and the problems that they go through. It is an act of kindness that we want to show as a part of the good gesture towards society.<\\/span><\\/p>\\\";s:10:\\\"video_link\\\";N;s:4:\\\"goal\\\";i:500;s:10:\\\"commissio