INSERT INTO `projects` (`id`, `user_id`, `title`, `slug`, `description`, `long_description`, `video_link`, `goal`, `commission`, `target`, `funded`, `start_date`, `end_date`, `recurring_days`, `status`, `display_on_home_status`, `created_at`, `updated_at`) VALUES
(1, 2, 'Feed Cows with grass of Love', 'feed-cows-with-grass-of-love', 'Feeding the hungry cows is a noble deed that help us to increase our good karma thereby also invites us some good luck.', '<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Cow has been a wonderful resource by God to mankind. They give us milk, helps us to do farming and provides us with manure to fertilize the land. Therefore it is our noble duty to feed her and take care of her in return. Feeding the hungry cows is a noble deed that help us to increase our good karma thereby also invites us some good luck. Let us all spread happiness and help the cows and animals to feed for themselves.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Loving the cows in return will help us to become noble citizens of this county. This is indeed a wonderful initiative taken up by 1INR founders. We need to sponsor deeds like this and help in spreading love and affection. Cows help us in numerous ways that is possible, so it is our humble duty to take care of her and feed her properly. As in Hindu Mythology, we worship the cow and it is a symbol of peace and love, so we need to treat her as one. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">We need to ensure we take proper care of her provide her the love and affection that she needs and desires. Doing this noble cause will also help us to increase our good karma thereby help us to bring good luck with us.</span></p>', NULL, 100, 10, 114, 234, '2019-10-12', '2022-12-31', 1, 1, 0, '2019-10-12 15:34:03', '2020-02-08 14:20:00'),
(2, 2, 'Paying Children education fee', 'paying-children-education-fee', 'All together we can help to sponsor a child the basic education so that we can help each other and help ourselves to shape the nation.', '<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">India is a developing nation and we still have about 33 million children who do not have access to proper education. In the need of the hour, we need to support child education so that these people have access to the basic right of education to become wonderful beings. Sponsoring the children\'s education will not only help the children to fulfill their dreams but also contribute towards the success of our nation. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">1INR has taken up the initiative to educate such people so that they are able to stand on their feet as well as sustain for themselves.There are many students who refuse to go to school simply because their parents cannot afford to provide them quality education. Therefore we as humans can help to sponsor a child basic education so that we can help each other and help ourselves to shape the nation.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> We as a developing nation need to help each other by supporting these noble causes. To care and help each other is the sole purpose of one-nation and helping humanity. So we are at 1INR are doing our best to support the cause and help each other. By doing this you are helping a child put a smile on his face.</span></p>', NULL, 100, 10, 114, 320, '2019-10-12', '2023-12-30', 30, 1, 0, '2019-10-12 15:36:52', '2020-02-08 10:57:35'),
(3, 2, 'Sponsoring Books for Students', 'sponsoring-books-for-students', 'Providing the children with free books will help them to learn and grow as well as help them to become better human beings.', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">There are many children who do not have the basic right to education. Providing these children with free books will help them to learn and grow as well as help them to become better human beings. This will also contribute towards the success of our country and we as a developing nation need to educate the young and the poor. </span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> This is a wonderful initiative taken up by 1INR founders that will help shape the future of our country. We urge you to support this initiative and help us to become a developed nation. Sponsoring any poor children&rsquo;s education will not only help the children fulfill their dreams but also help in the well being of the country.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> There has been a shortage of students going to learn in schools. Simply because they cannot afford school education. Sponsoring a child&rsquo;s education by giving them free books will not only help them to learn and grow but also help them to become better human beings in life. Therefore we need to sponsor such noble events and help one another to shape humanity and in turn shape our nation. We can always give our used textbooks to students in the previous class and help them.</span></p>', NULL, 500, 10, 570, 99, '2019-10-12', '2023-12-30', 7, 0, 0, '2019-10-12 15:40:19', '2020-03-16 05:08:56'),
(4, 2, 'Sponsoring Stationary for Students', 'sponsoring-stationary-for-students', 'By sponsoring a child’s education you help to fulfil their dreams but also help the parent who cannot afford to send their child to school', '<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">There are many people who do not have access to basic education and resources. Sponsoring a child\'s education by providing them stationary will not only help them to learn and grow but also make them a better and a humble human being. It is the need of our society to educate the poor and help them to survive and contribute towards building the nation. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">1INR has decided to sponsor a child\'s education and stationary for poor students. When the students have access to basic educational material then they will be willing to step forward and study and become wonderful human beings. Sponsoring a child&rsquo;s education you not only help to fulfill their dreams but you also help the parent who cannot afford to send their child to school. You help these needy children by supporting them and sponsoring their education fees. You help the children achieve their dreams and make their ambitions come true. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">By doing this noble deed you help to shape the society and contribute towards mankind. We need more people who can contribute towards this noble cause and help us shape and care for one another. We help each other to become what they desire for.</span></p>', NULL, 500, 10, 570, 100, '2019-10-12', '2023-12-30', 7, 1, 0, '2019-10-12 15:52:46', '2020-03-16 05:08:49'),
(5, 2, 'Feeding Pigeons Grains', 'feeding-pigeons-grains', 'This is an initiative taken up by 1INR to raise awareness to sponsor grains and water for hungry and thirsty birds', '<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Feeding the birds any kind of grains and water is an age old Hindu tradition that has been followed by our previous generations. It is said to invite luck as well as goodwill that increases ones karma. This is an initiative taken up by 1INR to raise awareness and make sure everyone does follow on this noble path. We have started this campaign to sponsor grains and water for hungry and thirsty birds who want to survive. This deed is similar to the ones that we do by feeding grass to cows or giving food to the poor people. It is synonymous with all these noble deeds. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">One can feed whatever grains they want to the birds and in return get some good luck.In the olden days, kings used birds as messengers. They are a part of our ecosystem, They help to maintain it. As a humanitarian effort, lets take up the duty of feeding the hungry and thirsty birds.Birds are noble animals and it fill our hearts with joy to hear them sing and tweet. </span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-indent: 36pt; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Chirpy birds help bring life to our environment. Be a part of this noble deed and increase your good karma. Let us give something back to mother nature. She has given us the most beautiful things.</span></p>', NULL, 100, 10, 114, 372, '2019-10-12', '2023-12-29', 1, 1, 0, '2019-10-12 16:02:36', '2020-03-16 05:08:36'),
(6, 2, 'Pehli Roti Dayitva Ki', 'pehli-roti-dayitva-ki', '1INR has collaborated with Hunger Project by Lions Club of Millennials and Lions Club of Churchgate Mumbai supported by Roti Bank.', '<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The campaign -<strong> PEHLI ROTI DAYITVA KI</strong> is Hunger Project by <strong>Lions Club of Millennials and Lions Club of Churchgate Mumbai supported by Roti Bank</strong>. The concept of the Campaign is very simple. It urges every Person, Families, Societies, Corporates, Schools, Hosts of Celebrations to Contribute their first Roti for poor, needy and hungry people. Roti is a purest form of contribution. People can contribute as minimum as 1 Roti at our Various collection center, spread all over Mumbai &amp; its suburbs. With support of Roti Bank, the Rotis collected from Various collection centers goes with full meal, like Vegetables and Rice, to poor Patients and their families who are living at and outside various Government Hospitals, to poor children of workers working on daily wages, to the schools for those children and to various Slums areas.</span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 11pt; white-space: pre-wrap;\">We have various collection center where you can donate the Rotis for the neady people. Also </span></span><strong style=\"color: #000000; font-family: Arial; font-size: 11pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; white-space: pre-wrap; text-decoration-line: none;\">1INR promotes two cause with one rupee. You can donate one rupee per day and 1INR will get rotis made from </strong><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><strong>housewife and Mahila Grih Udyogs</strong></span></span><strong style=\"color: #000000; font-family: Arial; font-size: 11pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; white-space: pre-wrap; text-decoration-line: none;\"> who needs money to fullfill their home and those rotis 1INR will send accross to the following centers on respective days.</strong></span></p>\r\n<p>&nbsp;<span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Our collection centers are as follows</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Sunday:</span></strong></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Byculla Motishah Jain Mandir </span><a href=\"https://foursquare.com/v/shri-aadinath-ji-jain-temple-sheth-motisha-jain-mandir/4e40b40462e17b948c203517\">https://4sq.com/2VcBUX2</a></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Worli Pankaj Mension </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2T4Dzvg</span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Kamathipura - Shree Naminath Jain Temple, Kamathipura </span></span></span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2vVhTcW</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Monday:</span></strong></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Girgaon CP Tank Madhav Bang </span><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">https://bit.ly/2HOng0q</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Tuesday:</span></strong></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Bharat Nagar Jain Temple, Grant Road </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2uqLlHy</span></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Pratiksha Tower, Navjeevan, Mumbai Central </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2uXGhuz</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Wednesday:</span></strong></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Babu Amichand Jain Mandir, Walkeshawar </span><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">https://bit.ly/2SR4WK4</span></p>\r\n<p><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Mulund- Zaver Road Jain Temple, Mulund West</span></span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"> https://bit.ly/32hEo80</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Thursday:</span></strong></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Jain Mandir, Vijay Wadi, Chira Bazaar </span><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">https://bit.ly/2wBux13</span></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Jain Mandir, Kabutar Khana, Dadar west </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2V8IFJw</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Friday:</span></strong></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Jain Mandir, </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Khetwadi 9th Lane </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/32fgdHs</span></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Village Road, </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Bhandup </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/32jnZ31</span></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Parksite, </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Vikhroli </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/39ZbDjh</span></p>\r\n<p><strong><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Every Saturday:</span></strong></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Pathan Jain Mandir, </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Marine Drive </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2SOFapP</span></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Dhobi Talao - Santoshi Mata Temple</span></p>\r\n<p><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Wagle Estate Thane </span><span style=\"font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">https://bit.ly/2SPRypD</span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">There are many people who do not have money to buy food. They go to sleep with their hungry stomachs. It is a pity to see people who have money and who splurge lavishly but fail to give the needy some food. 1INR has collaborated with NGOs and created the Roti Daan Campaign for the needy and poor people. </span></p>\r\n<p><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">In this campaign we make sure to donate the target amount of Rotis or Chapatis to poor and hungry people so that they can have a full meal and can go to bed with their stomach filled in and not sleep hungry.This initiative was possible only through 1INR team, who care about people and the problems that they go through. It is an act of kindness that we want to show as a part of the good gesture towards society.</span></p>', NULL, 500, 10, 570, 1658, '2019-10-12', '2024-12-28', 7, 1, 1, '2019-10-12 16:34:29', '2020-03-20 13:22:57'),
